description:
LED素子を使用したH11フォグ専用LEDバルブです 。<br>
従来のものに比べ、LEDの寿命はとても長く、発光熱が低いため省エネ・エコ・長寿命と環境にも優しく今話題となっています。<br>
<br>
7.5W級の高輝度LEDを前面に1発、側面に3発装着した合計4発のLEDが360°照射！<br>
LED特有のシャープ光、消費電力も少ないのでデイライト、ポジションとしての役目には充分すぎるほど活躍します。<br>
HIDとの相性も抜群！<br>
<br>
【セット内容】<br>
2個セット<br>
【サイズ】<br>
画像2をご参照ください。<br>
【送料について】<br>
こちらの商品は当店で扱っている商品との同梱発送は可能ですが、商品各々記載されている送料が発生致しますので予めご了承ください。
